import './Expense.css';

const Expense = (props) => {
  const data = props.onData;
  return (
    <div>
      <form>
        <label>Title</label>
        <input type='text' placeholder='Please eneter a title'/>
        <label>Price</label>
        <input type='number' placeholder='Please eneter a price'/>
        <label>Date</label>
        <input type='text' placeholder='Please eneter a title'/>
      </form>                                                                                                             
      {data.map((item) => (
        <div key={item.id} className="expense_wrapper">
          <div>
            <h1 className="title">{item.title}</h1>
            <div className="date">{item.date}</div>
          </div>
          <div>
            <span className="price">{`$${item.price}`}</span>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Expense;
